    {
      title: "job 2",
      description: "description 2",
      budget: 10,
    },
  ];

  return (
    <div>
      <h1 className="auth-title">Login</h1>
      <li>
        <ul>job 1</ul>
        <ul>description 1</ul>
      </li>
    </div>
  );
}

export default JobsPage;
